import React from "react";
import s from "./about.module.css";
import img_about from "../../assets/about/about.jpg";

const About = () => {
  return (
    <div className={s.aboutContainer}>
      <div className={s.mainText}>
        <h3 className={s.aboutTitle}>HI, WE ARE PRIMROSE TEAM</h3>
        <p>Мы производим готовые композиции, которые идеально подойдут к вашему интерьеру. Наши флористы отбирают самые красивые 
растения и сажают их в стильные кашпо LECHUZA с системой автополива. Полив растений очень прост:
всего несколько раз в месяц необходимо заливать воду.</p>
      </div>
      <div className={s.imageWrapper}>
        <img src={img_about}></img>
      </div>
    </div>
  );
};

export default About;
